import styled from "styled-components";
import Dummy from "../img/past/10.jpg";

const MainContainer = styled.div``;

const Album = styled.ul`
  height: calc(400vh - 72vh);
`;

const Photo = styled.li``;

const IMGFrame = styled.div`
  display: flex;
  justify-content: center;
  align-items: center;
  width: 100vw;
  height: var(--mobile-screen);
  background-color: white;
  border: 5px solid red;
  box-sizing: border-box;
`;

const RealIMG = styled.img`
  display: flex;
  justify-content: flex-start;
  align-items: flex-start;
  object-fit: contain;
  background-color: white;
  border: 5px solid purple;
  position: absolute;
  top: 0;
  width: 90vw;
`;

const IMGContainer = styled.div`
  width: 900px;
  height: 1600px;
  display: flex;
  flex-direction: column;
  justify-content: center;
  align-items: center;
  position: relative;
`;

function Main() {
  return (
    <div id="GlobalContainer" className="MainGlobalContiner">
      <MainContainer className="container">
        <Album className="unordered_list">
          <Photo className="list">
            <IMGContainer>
              <IMGFrame>
                <RealIMG src={Dummy} />
              </IMGFrame>
            </IMGContainer>
          </Photo>
          <Photo className="list">
            <IMGContainer>
              <IMGFrame>
                <RealIMG src={Dummy} />
              </IMGFrame>
            </IMGContainer>
          </Photo>
          <Photo className="list">
            <IMGContainer>
              <IMGFrame>
                <RealIMG src={Dummy} />
              </IMGFrame>
            </IMGContainer>
          </Photo>
          <Photo className="list">
            <IMGContainer>
              <IMGFrame>
                <RealIMG src={Dummy} />
              </IMGFrame>
            </IMGContainer>
          </Photo>
        </Album>
      </MainContainer>
    </div>
  );
}

export default Main;
